import React from "react";
import "./navbar.css";
// import icons from "./download/menu.svg";

class Navbar extends React.Component {
    constructor() {
        super();
    }
    render() {
        return (
            <div className="Navbar_wapp">
                <div className="logo"><h2><a href="#home">Sivaramakrishnan</a></h2></div>
                <nav className="navbar_mobile">
                    <ul>
                        <li><a href="#home">Home</a></li>
                        <li><a href="#about">About</a></li>
                        <li><a href="#skills">Skills</a></li>
                        <li><a href="#work">Work</a></li>
                        <li><a href="#contact">Contact</a></li>
                        <li className="login">
                            <a href="#login">Login</a>
                            {/* <i className="fas fa-sign-in"></i> */}
                        </li>
                    </ul>
                </nav>
                <div className="menu" onClick={()=>{this.setState({ismenu:!this.state.ismenu})}} >
                    <i class="fas fa-bars"></i>
                </div>
            </div>
        );
    }
}

export default Navbar;
